import React, { Component } from 'react';
import '../App.css';


class Footer extends Component {

	render() {
		return (
			<React.Fragment>

				<footer>
					<a href="/Oko/AboutUs" class="f_button">About Us</a>
					<a href="#aboutus" class="f_button">FAQs</a>
					<a href="#aboutus" class="f_button">Privacy</a>
					<a href="/Oko/AboutUs" class="f_button">Contact Us</a>
				</footer>
			</React.Fragment>
		);
	}
}

export default Footer;
